import './App.css';
import HeaderMain from './main/header/headerMain';
import HomeMain from './main/header/body/home/homeMain';
import AboutMe from './main/header/body/aboutMe/aboutMe';

function App() {
  return (
    <div className="App">
      <HeaderMain />
      <div className='contenedor'>
      <HomeMain />
      </div>

      <AboutMe />
    </div>
  );
};

export default App;
